import SearchBox from '../components/searchBox'
import Image from '../components/image'

const API_KEY = "H26hdxkNLCsDWSf0va7zkKgWhbEEv_vnJxnfk-OOLhI";

const HomePage = props => {
    const [value, setValue] = useState("");
const [images, setImages] = useState([])
    const onSearchSubmit = ()=>{
        fetch(`https://api.unsplash.com/search/photos/?&query=car&client_id=H26hdxkNLCsDWSf0va7zkKgWhbEEv_vnJxnfk-OOLhI`)    
    .then(response => response.json())
    .then(data =>{
        console.log(data)
        setImages(data.results);
    })                   
}

        return (
            <div>
<input
                className="inputStyle"
                type="text"
                placeholder="Search for images here..."
                value= {value}
                onChange={onSearchSubmit}
            />
                {/* <SearchBox userSubmit={onSearchSubmit}/> */}
                {/* <Image foundImages={setImages} /> */}
            </div>
        )
    }

export default HomePage;
